// src/App.js
import React from "react";
import Navbar from "./components/Navbar";

const App = () => {
  return (
    <div>
      <Navbar />
      <section id="home" style={{ height: "100vh", background: "#f0f0f0" }}>
        <h1>Home Section</h1>
      </section>
      <section id="about" style={{ height: "100vh", background: "#e0e0e0" }}>
        <h1>About Section</h1>
      </section>
      <section id="project" style={{ height: "100vh", background: "#d0d0d0" }}>
        <h1>Project Section</h1>
      </section>
      <section id="contact" style={{ height: "100vh", background: "#c0c0c0" }}>
        <h1>Contact Section</h1>
      </section>
    </div>
  );
};

export default App;
